  "instructions": "<p>It's a totally alternative location for level 250+, very fun to hunt, but loot and xp are average.</p>\n<p></p>\n<p>Be careful when there are üëø DIABOLIC IMPs:</p>\n<ul>\n  <li>As soon as he reduces your attack skills, use UTITO TEMPO to get your skills back and kill him as soon as possible.</li>\n  <li>He becomes invisible and attacks from a distance, so before using EXETA AMP RES throw an avalanche to cancel his invisibility.</li>\n</ul>\n<p>Be careful not to stay in front of üî• HELLFIRE FIGHTER because his wave causes very high damage.</p>\n<p>Focus on the Diabolic Imp, then the HFF and then the rest of the creatures.</p>\n<p></p>\n<p>Do not walk diagonally when in the area of ‚Äã‚Äãplaguesmiths and defilers as they paralyze and you can die in a combo.</p>\n<p></p>\n<p>üõ°Ô∏è<strong> Equipments</strong></p>\n<p>For attack you can use PHYSICAL and ICE ‚ùÑÔ∏è. For defense just use your regular equipment.</p>",
